import React from "react";
import "../components/searchpage.css"
function SearchPage(){
    return(
        <div className="searchpage">
            <div className="searchpage_filter">
              <i class="fa-sharp fa-solid fa-sliders"></i>
              <h2>Filter</h2>
            </div>
        </div>
    )
}
export default SearchPage
